edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/sfv_effect_client.proto";
import "youtube/api/innertube/sfv_effect_surface.proto";
import "youtube/api/innertube/media_engine_exporter_attempt_origin.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message ExportStartedEvent {
	SfvEffectClient client = 1;
	SfvEffectSurface client_surface = 2;
	MediaEngineExporterAttemptOrigin attempt_origin = 3;
}
